function Table( props ) {
    const { order,handeChangeStatus } = props
    return (
      order && order.length > 0 ?
      order.map((item,index) => {
      return (
        <tr key={index}>
           <td>{item.MaSP}</td>
           <td>{item.TenSP}</td>
           <td>{item.Variant}</td>
           <td>{item.MaLo}</td>
           <td>{item.SL}</td>
           <td>{item.DVT}</td>
           <td>{ item.Status===1 ? <button className='btn btn-outline-success'>Đã Lấy</button> 
                : <button className='btn btn-outline-info' onClick={()=>handeChangeStatus(item.MaDH,item.MaSP,item.MaLo)} id="liveToastBtn">Chưa Lấy</button>
            }</td>
        </tr>
      )
    })
    :
    <tr>
        <td colSpan={7} style={{'textAlign':'center',"color":"red"}}>Không có dữ liệu</td>
    </tr>
  );
}

export default Table;

